import React, { Component } from 'react'

let SONGKICK_URL = 'https://api.songkick.com/api/3.0/artists/39275915/gigography.json?apikey=XyKG4KDNOliuaDev'

class Homepage extends Component {

    constructor(props) {
        super(props);
        this.state = {
            data: null,
        }
    }

    componentWillMount() {
        fetch(SONGKICK_URL)
          .then(response => response.json())
          .then(data => this.setState({ data }));

      }

    // function showArtists(data) {
    //     this.setState({ data })
    //     console.log(data)
    // }      


render() {

    return(

        <ul>
        {data.map(data =>
          <li key={data.id}>
            <a>{data.displayName}</a>
          </li>
        )}
      </ul>

    )
}


}


export default Homepage
